import "./footer.css";
import React from "react";

const Footer = () => {
    return (
        <div className="footer">
            <ul className="fList">
                <li className="fListItem">Legal</li>
                <li className="fListItem">Privacy</li>
                <li className="fListItem">Cookie Policy</li>
                <li className="fListItem">Cookie Manager</li>
                <li className="fListItem">Imprint</li>
                <li className="fListItem">Artist Resources</li>
                <li className="fListItem">Blog</li>
            </ul>
        </div>
    );
};

export default Footer;
